-- (200) Generated rule: , CF.Status1, IF CF= "True" THEN CF.DataStatus = "Decline"
insert into SNX_FDN.WF3DROOLRULES (ID, RULEID, DROOLRULE) 
Values (200, 200, 'rule "CF.Status1"
     when
        $cs : ScreeningData();
        $caseinfo : CaseInfo();
    then
        String droolrulename = drools.getRule().getName();
        Logger log = getLogger(droolrulename);

        $cs.setDroolRule(droolrulename);
        log.info("************************************************");
        log.info("* Begin Processing Drools Rule: " + droolrulename +"");
        log.info("* " + $caseinfo);
        log.info("* Datapoint: caseId=" + $cs.getCaseId() + ", getDpEntryId=" + $cs.getDpEntryId() );
        log.info("************************************************");

        if(validateRuleCFStatus1(log, droolrulename, $cs, $caseinfo))
        {
            log.info("--------[Drool Success Status]--------");
            showRuleSuccessStatus(log, droolrulename);
        } else
        {
            showRuleFailedStatus(log, droolrulename);
        }
end

//IF CF= "True" 
//THEN CF.DataStatus = "Decline"
function boolean validateRuleCFStatus1(Logger log, String droolrulename, ScreeningData sc, CaseInfo caseinfo)
{
    boolean isSynid = false;
    


    if
    (
         isStringEqual(sc.getSynId(), "CF")
    )
    {
        //Flag that this DP was valid for a rule
        sc.setPassedRule(droolrulename);
        isSynid = true;
        
        sc.setDecline(true);
        sc.setDataStatus("Decline");
        
        log.info("SUCCESS! Datapoint " + sc.getDpEntryId() + " matched rule: " + droolrulename + "!");
    }

    return isSynid;
}');


